    state = {
        auctionId: 1
    }

    render() {
        console.log('auctionId',this.state.auctionId);
        return (
            <div>
                <PrettyHome>
                    hello world this is the home page
                    <br></br>
                    <Link className='logo' to={`/product/${this.state.auctionId}`} component={Product}>/product/:auctionId</Link>
                    {/* <Link className='logo' to={`/product/${}`} component={Product}>/product/:auctionId</Link> */}
                    <br></br>
                    <Link className='logo' to='/product' component={Product}>/product</Link>

                </PrettyHome>
            </div>

        )
    }
}

export default Home;
